  render() {
    return (
      <div>
        <Router>
        <NavBar/>
        <News pageSize={6} country="in" category="science"/>
        <Switch>
          <Route path="/about">
            <About />
          </Route>
        </Switch>
        </Router>
      </div>
    )
  }
}
